column8:
薄くてすっきりコンパクト、シンプルなデザインのLEDシーリングライトです♪<br>調光10段階、調色11段階＋常夜灯2段階の切り替えができます！<br>ランプ寿命が約40000時間と長寿命です。<br>おやすみタイマー（30分)は消し忘れ防止に役立ちます。<br>工事が不要で、今お使いのシーリングライトから取り付けアダプターなしで付け替えが簡単にできます。<br><br>●商品サイズ(cm)<br>直径約45×高さ約9.3<br>●重量(g)<br>1000<br>●材質<br>ポリプロピレン、鋼板<br>●適用畳数<br>～8畳用<br>●定格電圧<br>100v（50/60Hz）<br>●定格消費電力<br>約40W<br>●待機電力<br>0.5W<br>●光色<br>電球色～昼光色相当<br>●器具光束<br>4000lm<br>●演色性<br>80Ra<br>●設計寿命<br>40,000時間<br>●調光/調色<br>10/11段階<br>●常夜灯<br>2段階<br>●タイマー<br>切タイマー（30分）<br>●セット内容<br>LEDシーリングライト本体、取り付け用スペーサー（角・丸）<br>リモコン、リモコンホルダー、単4形乾電池2本、ネジ2本、取扱説明書<br><style type="text/css">

